$('input:radio[name="fileFormatId"]').click(function(){var a=parseInt($(this).val());switch(a){case dataGroupId:$("#tetrad_tab_data").show();break;default:$("#tetrad_tab_data").hide()}});$(document).ready(function(){$('input:radio[name="fileFormatId"]:checked').click();$("#title").editable({validate:function(a){if(a.trim().length===0){return"Please enter a title."}},success:function(a,b){if(a.status==="error"){return a.msg}else{$(".file_title").text(b)}}})});